import React from 'react';
import { ReactComponent as YourSvg } from '../logo.svg';

class MainPage extends React.Component {
   render() { 
      return <div className='border-b border-gray-300 py-4'>
         <YourSvg/>
         <img src='../logo.svg'/>
      </div>;
   }
}

export default MainPage;
